import React, { Component } from 'react'

export default class RenderProps extends Component {
    render() {
        return (
            <div>
                parent
                <A>
                    <B/>
                </A>
            </div>
        )
    }
}


class A extends Component {
    render() {
        console.log(this.props)
        return (
            <div>
                A
                {this.props.children}
            </div>
        )
    }
}

class B extends Component {
    render() {
        return (
            <div>
                B
            </div>
        )
    }
}
